con:configuration.scriptText:
import com.eviware.soapui.support.XmlHolder

def resp = messageExchange.response.responseContent

def parsedResp = new XmlHolder(resp)

parsedResp.namespaces["ns"] = "http://tempuri.org/"

def actualSum = parsedResp.getNodeValue("//ns:AddResponse/ns:AddResult")

def expSum = context.getTestCase().getPropertyValue("expSum")

assert actualSum == expSum
